let changeToThaiNumber = (num) => {
    var arr_change_number = {"1":"๑", "2":"๒", "3":"๓", "4" : "๔", "5" : "๕", "6" : "๖", "7" : "๗", "8" : "๘", "9" : "๙", "0" : "๐"};
    var str = num.toString();
    for (var val in arr_change_number){
        str = str.split(val).join(arr_change_number[val]);
    } 
    return str
}
let changeToNumber = (num) => {
    var arr_change_number = {"๑":"1", "๒":"2", "๓":"3", "๔" : "4", "๕" : "5", "๖" : "6", "๗" : "7", "๘" : "8", "๙" : "9", "๐" : "0"};
    var str = num.toString();
    for (var val in arr_change_number){
        str = str.split(val).join(arr_change_number[val]);
    } 
    return str
}

let DateDiff = function(a,b){
    return (new Date(new Date(b) - new Date(a)))/1000/60/60/24;
}
let formatDate3 = function(date) {
    var d = new Date(date),
        month = '' + (d.getMonth() + 1),
        day = '' + d.getDate(),
        year = d.getFullYear();

    if (month.length < 2) 
        month = '0' + month;
    if (day.length < 2) 
        day = '0' + day;

    return [year, month, day].join('-');
}
let ReverseStrThaiDate1 = function(StrThaiDate){
    var newDate = formatDate3(new Date());
    var months = ["มกราคม", "กุมภาพันธ์", "มีนาคม", "เมษายน", "พฤษภาคม", "มิถุนายน", "กรกฎาคม", "สิงหาคม", "กันยายน", "ตุลาคม", "พฤศจิกายน", "ธันวาคม"];
    if(StrThaiDate){
        if(StrThaiDate.indexOf(" ")>=0){
            var arr = StrThaiDate.split(" "),
                d=parseInt(arr[0]),m = 1,y=parseInt(arr[2])-543;
            if(months.indexOf(arr[1])>=0){
                m = months.indexOf(arr[1])+1;
                var mm = (m<10)?'0'+m:m;
                var dd = (d<10)?'0'+d:d;
                newDate = y+'-'+mm+'-'+dd;
            }
        }
    }
    
    return newDate;
}
